/* eslint-disable jsx-a11y/alt-text */
 
 import styles from './Header.module.css' 
 import Itelimg from '../../../public/itel.png'
 export function Header(){
    return(
        <header>
            <nav className={styles.header}>
            <span>DT Money</span>
            <img src={Itelimg}/> 
                <button type="button">Nova Transição</button>
         
            </nav>
        </header>
    )
    
}
